import React, { Component } from 'react';
import './experience.css';


class Experience extends Component {
    constructor() {
        super();

        this.state = {
            title: 'Front-end Engineer',
            desc: 'at Google, working with React',
            since: '2020',
            to: '2022',
            where: 'London, UK'
        }
    }

    render() {
        const { title, desc, since, to, where } = this.state;

        return (
            <div id="experience">
                <div id="headingwrap">
                    <div id="heading">WORK EXPERIENCE</div>
                    <button id="addExp">+</button>
                </div>

                <div className="flexwrap">
                    <div className="wrapperEdu">
                        <div className="title" contentEditable="true">{title}</div>
                        <div className="desc" contentEditable="true">{desc}</div>
                    </div>
                    <div className="wrapperEdu">
                        <div className="title time" contentEditable="true">{since}-{to}</div>
                        <div className="desc where" contentEditable="true">{where}</div>
                    </div>
                </div>

            </div>
        )
    }
}

export default Experience
